function mockAPICall(response: any, timeout: number): Promise<any> {
    return new Promise<any>((resolve) =>
        setTimeout(() => resolve(response), timeout)
    );
}

function randomTimeout(): number {
    const time: number = Math.random();
    const multiplier: number = Math.floor(Math.random() * 10 + 1);
    return time * multiplier;
}

export function fetchAnswers(): Promise<Array<string>> {
    return mockAPICall(
        ["AdaBoost", "DecisionTree", "LogisticRegression", "SupportVectorMachine", "NeuralNet", "NaiveBayes"],
        randomTimeout()
    )
}

export function checkAnswer(_id: number, algo: string) { // id is only important for reading from DB
    const answer = 'DecisionTree';
    return mockAPICall(
        { "correct": algo === answer, answer },
        randomTimeout(),
    )
}

